import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and enter XSS payload
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', '<script>alert("XSS")</script>');

    // Take screenshot after entering payload
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_input.png'));

    // Click search button using different selector strategy
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn:first-child');

    // Wait for potential page changes and take final screenshot
    await new Promise(resolve => setTimeout(resolve, 1000));
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Extract page content to verify XSS attempt
    const pageContent = await page.content();
    const xssDetected = pageContent.includes('<script>alert("XSS")</script>');

    return {
      success: true,
      action: "Attempted XSS injection via search input with payload: <script>alert('XSS')</script>",
      extractedData: {
        xssPayloadDetected: xssDetected,
        pageContentLength: pageContent.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete XSS injection attempt",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
